import React from 'react';
import { createStructuredSelector } from 'reselect';
import { connect } from 'react-redux';
import {selectShopCollectionsForPreview,selectShopCollection} from '../../redux/shop/shop.selector';
import CollectionPreview from '../collection-preview/collection-preview.component';

import './collection-overview.styles.scss';

const CollectionOverview = ({ collections,collSneakers }) => {
    console.log("Sneakers Coll"+JSON.stringify(collSneakers));
    return (
        <div className='collection-overview'>
            {collections.map(({ id, ...otherCollectionProps }) => (
                <CollectionPreview key={id} {...otherCollectionProps} />
            ))}
        </div>
    )
}

const mapStateToProps=(state)=>({
    collections: selectShopCollectionsForPreview(state),
    collSneakers: selectShopCollection("sneakers")(state)
})


export default connect(mapStateToProps)(CollectionOverview);
